import React from "react";
import { Tile } from "../../components/tile/Tile";

export const TileList = ({ contacts }) => {
  return (
    <div>
      {/* Use contacts prop instead of tiles */}
      {contacts.map((item, index) => (
        <Tile key={index} name={item.name} description={item} />
      ))}
    </div>
  );
};
